import React from 'react';

// import unsplash from '../api/unsplash';
class Table extends React.Component{
        constructor(props){
        super(props);
        // this.state = {forms:this.props.forms}
    }

    render(){

        
        console.log(this);
        return(
            <div>
                <table className="ui celled table">
                    <thead>
                        <tr>
                            <th>Form Id</th>
                            <th>Form Name</th>
                            <th># Submissions</th>
                            <th>Submit Page	</th>
                            <th>Submissions Page</th>
                    </tr>
                    </thead>
                    <tbody>{this.props.map(function(item,key){
                        return(
                            <tr key={key}>
                            <td data-label="Form Id">{item.id}</td>
                            <td data-label="Form Name">{item.Schema.title}</td>
                            <td data-label="# Submissions"></td>
                            <td data-label="Submit Page" >
                            <a  href={`/FormViewer/${item.id}/`}>View</a></td>
                            <td data-label="Submissions Page"></td>
                            </tr>
                         )
                        })}
                    </tbody>
                    </table>
                </div>
        );
    }
}

export default Table;
